const ForWho = () => {
  return (
    <div className="pt-2 pd-2 p-10 md-p-l5">
      <div id="for-who" className="md-w-100pc">
        <h2 className="white fs-l3 fw-900 lh-1">Для кого наша команда и наш курс</h2>
        <p className="indigo-lightest fw-600 fs-m1 opacity-50 my-5">
          Ты слышал про ноды для криптовалютных проектов и делаешь первые шаги в этом? Мы поможем
          тебе узнать основы и развить любовь к фундаменталу.
        </p>
      </div>
      <div
        //Add backgroung img
        className="relative w-100pc h-75vh bg-no-repeat bg-c bg-cover"
      ></div>
    </div>
  );
};

export default ForWho;
